  \"Advanced Ground Systems Maintenance Anomaly Detection Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 27,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:29:39.182020\",\n\t\"name\": \"advanced-ground-systems-maintenance-anomaly-detection-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;This project will develop the capability
  to identify anomalous conditions (indications to potential impending system failure)
  in ground system operations before such failures occur. These indicators are not
  presently detectable by traditional command and control and fault detection systems.
  &amp;nbsp;This project enables the delivery of system&amp;#39;s health advisories
  to ground system operators so they can take action prior to experiencing systems
  failures.&amp;nbsp;Inductive Monitoring System (IMS)&amp;nbsp;detected&amp;nbsp;anomalies
  can be sent to a diagnostic software&amp;nbsp;module for diagnosis.&lt;/p&gt;&lt;p&gt;Anomaly
  Detection provides the 21st Century Launch Complex Program with the ability to identify/recognize
  systems&amp;#39; anomalies before they become faults in the system; it supports
  the resolution of such anomalies to assure system availability and mission success.
  This capability also allows reduction in systems&amp;#39; maintenance costs by dictating
  when maintenance is needed (Maintenance-on-Demand) versus performing maintenance
  on schedule.&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
